import React from "react";
import emojipedia from "../emojipedia";
import Ret from "./Emoji";

function emojiRender(emojipedia) {
  return <Ret key={emojipedia.id} emoji={emojipedia.emoji} title={emojipedia.name} body={emojipedia.meaning} />
}

function App() {
  return <div>
    <h1>
      <span>emojipedia</span>
    </h1>
    <dl className="dictionary">
    {emojipedia.map(emojiRender)}
    </dl>
  </div>
}

